#include <stdio.h>
#include <string.h>
#include <stdlib.h>

int cmp(const void *a, const void *b) {
    return strcmp(*(char **)a, *(char **)b);
}

int main() {
    int n, l;
    scanf("%d %d", &n, &l);
    char **s = (char **)malloc(n * sizeof(char *));
    for (int i = 0; i < n; i++) {
        s[i] = (char *)malloc((l + 1) * sizeof(char));
        scanf("%s", s[i]);
    }
    qsort(s, n, sizeof(char *), cmp);
    for (int i = 0; i < n; i++) {
        printf("%s", s[i]);
    }
    printf("\n");
    for (int i = 0; i < n; i++) {
        free(s[i]);
    }
    free(s);
    return 0;
}
